	public static boolean saveSubImage(BufferedImage image, Rectangle bounds, File subImageFile)
		throws IOException
	{
		if (bounds.x < 0 || bounds.y < 0 || bounds.x + bounds.width > image.getWidth() || bounds.y + bounds.height > image.getHeight())
		{
			return false;
		} else
		{
			BufferedImage subImage = image.getSubimage(bounds.x, bounds.y, bounds.width, bounds.height);
			String fileName = subImageFile.getName();
			String formatName = fileName.substring(fileName.lastIndexOf('.') + 1);
			boolean boolea = ImageIO.write(subImage, formatName, subImageFile);
			return boolea;
		}
	}

	public static byte[] saveSubImage(BufferedImage image, Rectangle subImageBounds)
		throws IOException
	{
		if (subImageBounds.x < 0 || subImageBounds.y < 0 || subImageBounds.x + subImageBounds.width > image.getWidth() || subImageBounds.y + subImageBounds.height > image.getHeight())
		{
			return null;
		} else
		{
			BufferedImage subImage = image.getSubimage(subImageBounds.x, subImageBounds.y, subImageBounds.width, subImageBounds.height);
			ByteArrayOutputStream baops = new ByteArrayOutputStream();
			ImageIO.write(subImage, "jpg", baops);
			return baops.toByteArray();
		}
	}

