	public static byte[] cutImageToBytes(Rectangle rec, byte ImageBytes[])
		throws IOException
	{
		BufferedImage imag = ImageIO.read(new ByteArrayInputStream(ImageBytes));
		return saveSubImage(imag, rec);
	}

	public static byte[] cutImageToBytes(byte ImageBytes[])
		throws IOException
	{
		BufferedImage img = ImageIO.read(new ByteArrayInputStream(ImageBytes));
		int startX = 830;
		int startY = 715;
		int imageWidth = 620;
		int imageheight = 360;
		Rectangle rectangle = new Rectangle(startX, startY, imageWidth, imageheight);
		return saveSubImage(img, rectangle);
	}

	public static byte[] getSubimageBytes(InputStream srcImgStream, Rectangle bounds)
		throws IOException
	{
		BufferedImage srcImg = ImageIO.read(srcImgStream);
		int srcWidth = srcImg.getWidth();
		int srcHeight = srcImg.getHeight();
		if (bounds.x < 0)
			bounds.x = 0;
		else
		if (bounds.x >= srcWidth)
			bounds.x = srcWidth - 1;
		if (bounds.y < 0)
			bounds.y = 0;
		else
		if (bounds.y >= srcHeight)
			bounds.y = srcHeight - 1;
		if (bounds.width < 1 || bounds.x + bounds.width > srcWidth)
			bounds.width = srcWidth - bounds.x;
		if (bounds.height < 1 || bounds.y + bounds.height > srcHeight)
			bounds.height = srcHeight - bounds.y;
		BufferedImage subImage = srcImg.getSubimage(bounds.x, bounds.y, bounds.width, bounds.height);
		ByteArrayOutputStream byteOut = new ByteArrayOutputStream();
		ImageIO.write(subImage, "jpg", byteOut);
		return byteOut.toByteArray();
	}

	public static byte[] getThumbnailBytes(InputStream srcImgStream, double scale)
		throws IOException
	{
		BufferedImage srcImg = ImageIO.read(srcImgStream);
		if (scale <= 1.0000000000000001E-005D || scale > 1.0D)
			scale = 1.0D;
		int width = (int)Math.round((double)srcImg.getWidth() * scale);
		int height = (int)Math.round((double)srcImg.getHeight() * scale);
		if (width < 1)
			width = 1;
		if (height < 1)
			height = 1;
		BufferedImage thumbnail = new BufferedImage(width, height, 1);
		thumbnail.getGraphics().drawImage(srcImg, 0, 0, width, height, null);
		ByteArrayOutputStream byteOut = new ByteArrayOutputStream();
		ImageIO.write(thumbnail, "jpg", byteOut);
		return byteOut.toByteArray();
	}
